define({ "api": [  {    "type": "post",    "url": "/api/captcha",    "title": "生成验证码",    "version": "0.0.1",    "name": "APIcaptcha",    "group": "API",    "description": "<p>注意可以不传参数,但是必须用jwt传输</p>",    "parameter": {      "fields": {        "Parameter": [          {            "group": "Parameter",            "type": "Number",            "optional": false,            "field": "size",            "description": "<p>验证码位数(NULL)</p>"          },          {            "group": "Parameter",            "type": "String",            "optional": false,            "field": "ignoreChars",            "description": "<p>不包含的字符(NULL)</p>"          }        ]      },      "examples": [        {          "title": "Success-Example",          "content": "\n{\n  status: { code: 0, httpcode: 200 },\n  data:\n  {\n    text: 'HjJu',\n    captcha: 'svg'\n  },\n  msg: ''\n}",          "type": "json"        }      ]    },    "success": {      "fields": {        "Success 200": [          {            "group": "Success 200",            "type": "Json",            "optional": false,            "field": "data",            "description": "<p>&quot;text&quot;:&quot;验证码&quot;, &quot;captcha&quot;: &quot;svg格式字符串&quot;</p>"          }        ]      }    },    "error": {      "fields": {        "Error 4xx": [          {            "group": "Error 4xx",            "type": "Json",            "optional": false,            "field": "status",            "description": "<p>&quot;code&quot;: &quot;-1&quot;</p>"          }        ]      }    },    "filename": "back/routes/api/api.js",    "groupTitle": "API"  },  {    "type": "post",    "url": "/api/send",    "title": "发送短信",    "version": "0.0.1",    "name": "APIsend",    "group": "API",    "permission": [      {        "name": "none"      }    ],    "description": "<p>短信发送描述.</p>",    "parameter": {      "fields": {        "Parameter": [          {            "group": "Parameter",            "type": "String",            "optional": false,            "field": "tel",            "description": "<p>phone NO.</p>"          },          {            "group": "Parameter",            "type": "Number",            "optional": false,            "field": "tpl_id",            "description": "<p>template ID.</p>"          },          {            "group": "Parameter",            "type": "Array",            "optional": false,            "field": "params",            "description": "<p>template content array.</p>"          },          {            "group": "Parameter",            "type": "String",            "optional": false,            "field": "exp",            "description": "<p>13位过期时间.</p>"          }        ]      },      "examples": [        {          "title": "Request-Example:",          "content": "{\n  \"tel\": 11011912020,\n  \"tpl_id\": 110,\n  \"params\": [\"验证码\", \"1234\", \"4\"],\n  \"ext\": \"可选字段\"  //可选字段，不需要就填空。用户的session内容，腾讯server回包中会原样返回\n  \"exp\": \"1000000000000\"  // Data.now() + 1000\n}",          "type": "json"        },        {          "title": "Success-Example",          "content": "\n{\n  status: { code: 0, httpcode: 200 },\n  data:\n    { result: '0',\n      errmsg: 'OK',\n      ext: '',\n      sid: '8:Se9tJwqtwU9TjwIpq6T20161117',\n      count: 1,\n      fee: 2\n    },\n  msg: ''\n}",          "type": "json"        },        {          "title": "Error-Example",          "content": "{\n  status:\n  { code: -1, httpcode: 500 },\n  data:\n  {\n      name: 'JsonWebTokenError',\n      message: 'invalid signature'\n  },\n  msg: '验证出错'\n }",          "type": "json"        }      ]    },    "success": {      "fields": {        "Success 200": [          {            "group": "Success 200",            "type": "String",            "optional": false,            "field": "status",            "description": "<p>成功状态</p>"          },          {            "group": "Success 200",            "type": "Json",            "optional": false,            "field": "data",            "description": "<p>服务器返回数据(result:0 发送成功).</p>"          },          {            "group": "Success 200",            "type": "String",            "optional": false,            "field": "msg",            "description": "<p>空(保留字段)</p>"          }        ]      }    },    "error": {      "fields": {        "Error 4xx": [          {            "group": "Error 4xx",            "type": "String",            "optional": false,            "field": "status",            "description": "<p>失败状态</p>"          },          {            "group": "Error 4xx",            "type": "Json",            "optional": false,            "field": "data",            "description": "<p>name(出错类型),message(出错信息)</p>"          },          {            "group": "Error 4xx",            "type": "String",            "optional": false,            "field": "msg",            "description": "<p>服务器批注</p>"          }        ]      }    },    "filename": "back/routes/api/api.js",    "groupTitle": "API"  }] });
